window.bookSummaryJSON = "<p><b><i>\"I knew it would all end in tears the moment I saw...the hat.\"</i></b></p> <p>Placed under a death debt to a local king by the actions of her mother, Cups finds she can't grow her wings like a proper fairy should. Faced with a sentence of life without the possibility of flight unless she can fulfill her mother's oath, she takes a job at the castle as the Least Jester - only to find the job riddled with all manner of dangers from cupcakes to tea daemons to earth dragons and, worst of all, daydreaming princesses.</p> <p>Suitable for younger audiences and saturated with tea and razor wit, ArtisticWhispers Productions and <i>New York Times</i> best-selling author Gail Carriger bring you a belly-full of light comedy in this full-cast production with original music by Danny Schade.</p>"; 
